precision highp float;
varying vec2 textureCoordinate;
uniform sampler2D inputImageTexture;
uniform sampler2D uvTexture;
uniform mat3 convertMatrix;
uniform vec3 offset;

void main()
{
    highp vec3 yuvColor;
    highp vec3 rgbColor;

    // Get the YUV values
    yuvColor.x = texture2D(inputImageTexture, textureCoordinate).r;
    yuvColor.y = texture2D(uvTexture, vec2(textureCoordinate.x, textureCoordinate.y * 0.5)).r;
    yuvColor.z = texture2D(uvTexture, vec2(textureCoordinate.x, textureCoordinate.y * 0.5 + 0.5)).r;

    // Do the color transform
    yuvColor += offset;
    rgbColor = convertMatrix * yuvColor;

    gl_FragColor = vec4(rgbColor, 1.0);
}

varying highp vec2 textureCoordinate;

uniform sampler2D inputImageTexture;

void main()
{
     gl_FragColor = texture2D(inputImageTexture, vec2(1.0 - textureCoordinate.x, textureCoordinate.y));
}

