precision highp float;
varying highp vec2 textureCoordinate;
uniform sampler2D inputImageTexture;
uniform mat3 matrix;

void main()
{
  float cv_y = 1.0 - textureCoordinate.y;
  float denominator = matrix[0][2] * textureCoordinate.x + matrix[1][2] * cv_y + matrix[2][2];
  vec2 dst_coords;
  dst_coords.x = matrix[0][0] * textureCoordinate.x + matrix[1][0] * cv_y + matrix[2][0];
  dst_coords.y = matrix[0][1] * textureCoordinate.x + matrix[1][1] * cv_y + matrix[2][1];
  dst_coords.x = dst_coords.x / denominator;
  dst_coords.y = 1.0 - (dst_coords.y / denominator);
  gl_FragColor = texture2D(inputImageTexture, dst_coords);
}

